import React, { Component } from "react";

class WeatherSetInfo extends Component {
  render() {
    const { date, temperature, weather } = this.props.set;
    return (
      <div className="">
        <li>{date}</li>
        <li>{temperature.temp}</li>
        <li>{weather.main}</li>
      </div>
    );
  }
}

export default WeatherSetInfo;
